INSERT INTO `fly_article` ( `article_id`, `cat_id`, `title`, `content`, `author`, `author_email`, `keywords`, `article_type`, `is_open`, `add_time`, `file_url`, `open_type`, `link`, `description`, `sort_order` ) VALUES 
 ( '1', '2', 'OBD国际贸易商商', '', '', '', '', '0', '1', '1379320263', '', '0', 'http://', '', '1' ),
 ( '2', '2', '国内OBD经销商', '', '', '', '', '0', '1', '1379320263', '', '0', 'http://', '', '1' ),
 ( '3', '2', '汽修大师', '', '', '', '', '0', '1', '1379320263', '', '0', 'http://', '', '1' ),
 ( '4', '2', 'OBD设备爱好者', '', '', '', '', '0', '1', '1379320263', '', '0', 'http://', '', '1' ),
 ( '67', '2', '我们的优势', '<p>&nbsp; &nbsp; &nbsp;&nbsp;</p><p><br/></p><p><br/></p><p><span style=\"font-size: 24px;\"><strong>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;OBD设备研发专家团队创办组建&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;深耕OBD行业15年，研发经验丰富</strong></span></p><p><span style=\"font-size: 24px;\"><strong><br/></strong></span></p><p><br/></p><p><br/></p><p><span style=\"font-size: 24px;\"><strong>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;所有产品拥有独立自主知识产权&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; 追求研发卓越产品，有良好的行业口碑</strong></span></p><p><span style=\"font-size: 24px;\"><strong><br/></strong></span></p><p><br/></p><p><br/></p><p><span style=\"font-size: 24px;\"><strong>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;产品兼容车型覆盖面积广，兼容性强&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;开放合作，低门槛，高收益，售后保证</strong></span></p><p><br/></p>', '', '', '', '0', '0', '1562528640', '', '0', 'http://', '', '1' ),
 ( '68', '2', '关于我们', '<div style=\"margin-right: 20px; float: left;\"><p style=\"margin: 15px;\"><iframe width=\"600\" height=\"468\" align=\"left\" src=\"https://v.qq.com/txp/iframe/player.html?vid=y0711v77egh\" frameborder=\"0\" scrolling=\"yes\"></iframe>\r\n &nbsp; &nbsp;</p></div><p style=\"margin: 15px; padding: 0px; text-indent: 0px;\"><span style=\"color: rgb(102, 102, 102); letter-spacing: 0px; font-family: 微软雅黑;\">&nbsp; &nbsp; &nbsp;深圳市硕泰昌科技有限公司</span><span style=\"color: rgb(102, 102, 102); letter-spacing: 0px; font-family: 微软雅黑;\">(简称“硕泰昌科技”)成立于2012年，是一家汽车诊断仪、汽车编程器、汽车防盗器等OBD设备制造商、云诊断平台以及汽车车载系统解决方案提供商。硕泰昌科技创办至今，凭借雄厚的研发实力打造出的产品深受汽修维修师傅喜爱并获得良好口碑。在未来我司将继续深耕OBD行业，为汽修维修师傅提供物美价廉好用又好使的良心产品。&nbsp; &nbsp; &nbsp; &nbsp;&nbsp;</span><br/></p><p style=\"margin: 15px; padding: 0px; text-indent: 0px;\"><span style=\"color: rgb(102, 102, 102); letter-spacing: 0px; font-family: 微软雅黑; font-size: 16px;\">&nbsp; &nbsp; &nbsp;与此同时，我司将与时俱进潜心研发云诊断平台，利用互联网思维整合资源，利用物联网、大数据以及人工智能技术让云诊断变得“更智能，更懂你”。&nbsp;&nbsp; &nbsp;</span></p><p style=\"margin: 15px; padding: 0px; text-indent: 0px;\"><span style=\"color: rgb(102, 102, 102); letter-spacing: 0px; font-family: 微软雅黑; font-size: 16px;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;硕泰昌科技始终坚持“良心产品，匠心打造”产品研发思路，以客户为中心的<span style=\"font-family: 微软雅黑;\">服务宗旨，以开放、包容、公平、共赢为合作基础。</span>&nbsp;让我们一起携手共进，开创未来！</span></p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><h1 style=\"text-align: left; font-size: 32px; font-weight: bold;\" label=\"标题居左\"><span style=\"color: rgb(51, 51, 51); font-family: 微软雅黑;\">品牌发展史</span></h1><p><span style=\"color: rgb(51, 51, 51); font-family: 微软雅黑;\"><br/></span></p><p><span style=\"color: rgb(102, 102, 102); font-family: 微软雅黑;\"><strong><span style=\"color: rgb(102, 102, 102); font-family: 微软雅黑; font-size: 20px;\">2012年</span></strong></span></p><p><span style=\"color: rgb(102, 102, 102); font-family: 微软雅黑;\">&nbsp; &nbsp; &nbsp; &nbsp;6月，深圳市硕泰昌科技有限公司成立于深圳市南山区粤海街道，确定并专注汽车专检设备和汽车钥匙编程器研发为公司主要发展方向。</span></p><p><strong style=\"color: rgb(102, 102, 102); font-family: 微软雅黑;\">&nbsp; &nbsp; &nbsp; &nbsp;</strong><span style=\"color: rgb(102, 102, 102); font-family: 微软雅黑;\">8月，研发出第一款本田专检工具FLY100一代，解决世界难题——本田无需密码做防盗功能。与此同时确定FLY品牌发展方向。</span></p><p><span style=\"color: rgb(102, 102, 102); font-family: 微软雅黑;\"><span style=\"color: rgb(102, 102, 102); font-family: 微软雅黑; font-size: 20px;\"><strong>2013年</strong></span>,先后推出FLY108 pro、FLY200 pro、FLY308 pro、FLY508 pro等FLY系列产品</span></p><p><span style=\"color: rgb(102, 102, 102); font-family: 微软雅黑; font-size: 20px;\"><strong>2014年</strong></span></p><p><span style=\"color: rgb(102, 102, 102); font-family: 微软雅黑;\"><strong>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp;</strong>3月，研发出第一款汽车诊断仪兼钥匙编程器FVDI2014，确定综合诊断仪兼钥匙编程器产品命名为FVDI系列产品。</span></p><p><span style=\"color: rgb(102, 102, 102); font-family: 微软雅黑;\">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp;5月，第一款纯汽车钥匙编程器TM100正式问世。</span><br/></p><p><span style=\"color: rgb(102, 102, 102); font-family: 微软雅黑;\">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp;9月，参展德国法兰克福汽车零配件展览会</span></p><p><span style=\"color: rgb(102, 102, 102); font-family: 微软雅黑; font-size: 20px;\"><strong>2015年</strong></span></p><p><span style=\"color: rgb(102, 102, 102); font-family: 微软雅黑;\">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp;4月，FVDI2014高级版FVDI2015正式发布</span></p><p><span style=\"color: rgb(102, 102, 102); font-family: 微软雅黑;\">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp;6月，FLY100二代正式发布</span><br/></p><p><span style=\"color: rgb(102, 102, 102); font-family: 微软雅黑;\">&nbsp; &nbsp; &nbsp; &nbsp;11月，丰田专检TOYOTA&nbsp;OTC 2正式发布</span></p><p><span style=\"color: rgb(102, 102, 102); font-family: 微软雅黑; font-size: 20px;\"><strong>2016年</strong></span><span style=\"color: rgb(102, 102, 102); font-family: 微软雅黑;\">，先后推出捷豹路虎专检设备JLR SDD 2,福特马自达专检设备 VCM&nbsp;IDS 3,OBD终结者，FVDI2</span></p><p><span style=\"color: rgb(102, 102, 102); font-family: 微软雅黑; font-size: 20px;\"><strong>2018年</strong></span></p><p><span style=\"color: rgb(102, 102, 102); font-family: 微软雅黑;\">&nbsp; &nbsp; &nbsp; &nbsp; 4月，FVDI2018发布出售</span></p><p><span style=\"color: rgb(102, 102, 102); font-family: 微软雅黑;\">&nbsp; &nbsp; &nbsp; &nbsp; 8月，SVCI J2534(FVDI J2534)发布出售，确定公司转型升级<span style=\"color: rgb(102, 102, 102); font-family: 微软雅黑;\">SVCI</span>产品发展方向，主打STIC品牌</span></p><p><span style=\"font-size: 20px;\"><strong style=\"color: rgb(102, 102, 102); font-family: 微软雅黑;\">2019年</strong></span><br/></p><p><span style=\"color: rgb(102, 102, 102); font-family: 微软雅黑;\">&nbsp; &nbsp; &nbsp; &nbsp;5月，捷豹路虎专检设备<span style=\"color: rgb(102, 102, 102); font-family: 微软雅黑;\">高级版</span>SVCI DoI正式发售</span></p><p><strong style=\"color: rgb(102, 102, 102); font-family: 微软雅黑;\">&nbsp; &nbsp; &nbsp; &nbsp;</strong><span style=\"color: rgb(102, 102, 102); font-family: 微软雅黑;\">6月，因公司转型升级要求，变更FLY品牌，主打STIC品牌，更改FVDI系列产品为SVCI系列产品</span></p><p><span style=\"color: rgb(102, 102, 102); font-family: 微软雅黑;\">&nbsp; &nbsp; &nbsp;10月，SVCI2020即将发售</span></p><p><span style=\"color: rgb(102, 102, 102); font-family: 微软雅黑;\">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;<br/></span></p><p style=\"padding: 0px; margin-top: 15px; margin-right: 15px; margin-bottom: 15px;\"><span style=\"color: rgb(102, 102, 102); letter-spacing: 0px; font-family: 微软雅黑; font-size: 16px;\"><br/></span></p><h1 style=\"text-align: left; font-size: 32px; font-weight: bold;\" label=\"标题居左\"><span style=\"color: rgb(51, 51, 51); font-family: 微软雅黑;\">公司专利</span></h1><h1 style=\"text-align: left; font-size: 32px; font-weight: bold;\" label=\"标题居左\"><span style=\"color: rgb(51, 51, 51); font-family: 微软雅黑;\"><span style=\"color: rgb(102, 102, 102); font-family: 微软雅黑;\"><img width=\"921\" height=\"1153\" title=\"SVCI商标\" style=\"width: 326px; height: 406px;\" src=\"/images/upload/20190820/15662886912730.png\"/>&nbsp;<img width=\"921\" height=\"1156\" title=\"保驰云诊断（电脑版）\" style=\"width: 333px; height: 398px;\" src=\"/images/upload/20190820/15662888054558.png\"/><img width=\"920\" height=\"1155\" title=\"保驰云诊断(安卓版)\" style=\"width: 338px; height: 397px;\" src=\"/images/upload/20190820/15662888784690.png\"/></span></span></h1><h1 style=\"text-align: left; font-size: 32px; font-weight: bold;\" label=\"标题居左\"><span style=\"color: rgb(51, 51, 51); font-family: 微软雅黑;\"><span style=\"color: rgb(102, 102, 102); font-family: 微软雅黑;\"><span style=\"color: rgb(102, 102, 102); font-family: 微软雅黑;\"><img width=\"922\" height=\"1154\" title=\"FVDI J2534外观专利.png\" style=\"width: 332px; height: 407px; float: none;\" src=\"/images/upload/20190820/15662889633808.png\"/><img width=\"921\" height=\"1156\" title=\"FVDI外观专利.png\" style=\"width: 342px; height: 409px; float: none;\" src=\"/images/upload/20190820/15662889635402.png\"/><img width=\"921\" height=\"1156\" title=\"TM100外观专利.png\" style=\"width: 340px; height: 406px; float: none;\" src=\"/images/upload/20190820/15662889631399.png\"/></span></span></span></h1><p>&nbsp;</p><h1 style=\"text-align: left; font-size: 32px; font-weight: bold;\" label=\"标题居左\"><span style=\"color: rgb(51, 51, 51); font-family: 微软雅黑;\">行业地位</span></h1><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp; &nbsp; &nbsp; &nbsp;<span style=\"color: rgb(102, 102, 102); font-family: 微软雅黑;\">截至目前为止硕泰昌科技所研发出来的产品覆盖了市场上主流车型的维修需求，客户遍及全世界各个角落所研发的产品均得到客户认可和信赖。现有产品获得欧盟认证、国内3C认证与此同时我们也取得欧盟商标、国内商标、欧盟外观专利和国内外观专利，所有产品均为自主研发且具有独立自主知识产权。目前最具有代表性专检设备有福特马自达SVCI J2534、捷豹路虎SVCI DoIP、通用福特克莱斯勒SVCI GFC,本田FLY100二代，丰田TOYOTA OTC 2等，汽车钥匙编程器代表性产品有SVCI2、SVCI2014、SVCI2015、SVCI2018、SVCI2020等，到目前为止我司最前沿代表性产品为SVCI TAG+、保驰云诊断。</span></p><p><span style=\"color: rgb(102, 102, 102); font-family: 微软雅黑;\">&nbsp; &nbsp; &nbsp; 福特马自达等专检设备在国内市场占有率达76%之多，全球市场占有率达12%,年最高出货量达5426套，并且每年都在持续增长。</span></p><p><span style=\"color: rgb(102, 102, 102); font-family: 微软雅黑;\">&nbsp; &nbsp; &nbsp; 钥匙编程器SVCI2/2014/2015/2018/2020截至目前为止国外市场占有率达64%，出货量达到87963套。</span></p><p><span style=\"color: rgb(102, 102, 102); font-family: 微软雅黑;\">&nbsp; &nbsp; &nbsp; 钥匙编程器最前沿产品SVCI TAG+，未来两年预计将以600%的速度疯狂增长，三年内全球市场占有率可达85%以上。</span></p><p>&nbsp;</p><p>&nbsp;</p><p><span style=\"color: rgb(102, 102, 102); font-family: 微软雅黑;\"><br/></span></p><h1 style=\"text-align: left; font-size: 32px; font-weight: bold;\" label=\"标题居左\"><span style=\"color: rgb(51, 51, 51); font-family: 微软雅黑;\">团队介绍</span></h1><p>&nbsp;</p><p><span style=\"color: rgb(51, 51, 51); font-family: 微软雅黑; margin-left: 10px;\"><iframe width=\"534\" height=\"344\" align=\"right\" class=\"ueditor_baidumap\" src=\"http://localhost/plugins/ueditor/dialogs/map/show.html#center=113.931522,22.515178&zoom=18&width=530&height=340&markers=113.930327,22.514761&markerStyles=l,A\" frameborder=\"0\"></iframe></span></p><p><span style=\"color: rgb(102, 102, 102); font-family: 微软雅黑;\">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp;深圳市硕泰昌科技有限公司由三位国内OBD行业顶级专家创办而成，三位创始人曾就职于国内OBD行业巨头公司，拥有15年以上行业积累以及雄厚的研发实力。</span></p><p><span style=\"color: rgb(102, 102, 102); font-family: 微软雅黑;\">&nbsp; &nbsp; &nbsp; &nbsp; 硕泰昌科技<span style=\"color: rgb(102, 102, 102); font-family: 微软雅黑;\">是一家以技术驱动为主的科技公司，公司研发人员占据了76%，公司管理人员、销售人员和其它部门人员仅占据24%。公司目前员工<span style=\"color: rgb(102, 102, 102); font-family: 微软雅黑;\">98%来自本科院校，平均年龄32岁，</span></span>核心技术人员<span style=\"color: rgb(102, 102, 102); font-family: 微软雅黑;\">以及公司管理人员100%拥有本科学历，</span>他们大多数人曾经就职于上市公司，核心技术人员均拥有扎实的技术功底对OBD行业有充分的认知。</span></p><p><span style=\"color: rgb(102, 102, 102); font-family: 微软雅黑;\">&nbsp; &nbsp; &nbsp; &nbsp; 公司实行扁平化管理<span style=\"color: rgb(102, 102, 102); font-family: 微软雅黑;\">方式</span>，实行不打卡，不加班，打造公司和个人，共进退，共命运体系，充分体现以人为本的管理方式和合伙人管理模式。</span></p><p><span style=\"color: rgb(102, 102, 102); font-family: 微软雅黑;\">&nbsp; &nbsp; &nbsp; &nbsp;公司注册地和办公地址所在地：广东省深圳市南山区粤海街道5号动漫园1栋。</span></p>', '', '', '', '0', '1', '1562542563', 'data/article/1562624681677885657.jpg', '0', 'http://', '', '1' ),
 ( '69', '2', '产品优势', '<p><strong style=\"font-size: 24px;\"><br/></strong></p><p><strong style=\"font-size: 24px;\">兼容性</strong><br/></p><p><span style=\"font-size: 16px;\">&nbsp; &nbsp; &nbsp;</span><br/></p><p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;<span style=\"font-size: 16px;\">自主研发的福特马自达专检设备SVCI J2534、捷豹路虎SVCI DoIP、美系车通用，福特，克莱斯勒三合一专检设备SVCI GFC3 pro、尼桑，英菲尼迪，GTR加强版专检设备SVCI NIG3 plus 、本田专检设备FLY100二代，丰田专检设备TOYOTA OTC 2, 分别可完全兼容福特马自达、捷豹路虎、通用、克莱斯勒、尼桑、英菲尼迪、GTR、本田、丰田全车型所有维修所需功能，是完全可替代原厂专检设备的解决方案，基本上覆盖市面上绝大部分主流车型，兼容性世界第一。</span></p><p><span style=\"font-size: 18px;\"><br/></span></p><p><span style=\"font-size: 18px;\"></span></p><p><span style=\"font-size: 24px;\"><strong>自主性</strong></span></p><p><span style=\"font-size: 18px;\">&nbsp; <span style=\"font-size: 16px;\">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; </span>&nbsp; &nbsp; &nbsp;&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;</span></p><p><span style=\"font-size: 18px;\"></span></p><p>&nbsp; &nbsp; &nbsp; &nbsp; <span style=\"font-size: 16px;\">&nbsp; &nbsp;所有产品均有独立自主知识产权，均以取到商标权、外观设计所有权以及软件著作权。所有产品硬件设计和软件开发均由我司技术团队独立自主完成，对核心技术拥有绝对掌控力和产品的可控性。</span></p><p><span style=\"font-size: 18px;\"><br/></span><br/></p>', '', '', '产品优势', '0', '1', '1565663202', 'data/article/1565802004299419748.jpg', '2', 'http://', '产品优势', '1' );
