 ( '1', '深圳市硕泰昌科技有限公司', '深圳市硕泰昌科技有限公司,硕泰昌,stic,福莱,fly', ' 深圳市硕泰昌科技有限公司(简称“硕泰昌科技”)成立于2012年，是一家汽车诊断仪、汽车编程器、汽车防盗器等OBD设备制造商、云诊断平台以及汽车车载系统解决方案提供商。硕泰昌科技创办至今，凭借雄厚的研发实力打造出的产品深受汽修维修师傅喜爱并获得良好口碑。在未来我司将继续深耕OBD行业，为汽修维修师傅提供物美价廉好用又好使的良心产品。              与此同时，我司将与时俱进潜心研发云诊断平台，利用互联网思维整合资源，利用物联网、大数据以及人工智能技术让云诊断变得“更智能，更懂你”。           硕泰昌科技始终坚持“良心产品，匠心打造”产品研发思路，以客户为中心为服务宗旨，以开放、包容、公平、共赢为合作基础。相信梦想，相信未来!!!', 'index' ),
